import React from 'react';
import {
  Radar,
  RadarChart,
  PolarGrid,
  PolarAngleAxis,
  PolarRadiusAxis
} from 'recharts';
import '../Css/Dashboard.css';

const data = [
  { subject: 'Dominant', A: 20 },
  { subject: 'Invloedrijk', A: 10 },
  { subject: 'Stabiel', A: 30 },
  { subject: 'Censcientieus', A: 25 },
];

const options = {
  scales: {
    r: {
      grid: {
        circular: true,
      },
      beginAtZero: true,
    },
  },
};

const Dashboard = () => {
  return (
    <div className="dashboard">
      <div className="sidebar">
        <div className="logo" />
        <hr />
        <div className="navigation">
          <button className="nav-button active">Dashboard</button>
          <button className="nav-button">Company</button>
        </div>
      </div>
      <div className="main">
        <div className="header">
          <hr />
          <div className="page-title">Dashboard</div>
        </div>
        <div className="content">
          <div className="radar-chart">
            <RadarChart
              cx={300}
              cy={250}
              outerRadius={150}
              width={600}
              height={500}
              data={data}
              options={options}
            >
              <PolarGrid />
              <PolarAngleAxis dataKey="subject" />
              <PolarRadiusAxis angle={30} domain={[0, 40]} />
              <Radar
                name="Mike"
                dataKey="A"
                stroke="#3487C7"
                fill="#3487C7"
                fillOpacity={0.6}
              />
            </RadarChart>
          </div>
          <div className="results">
            <h2>Resultaat: 75</h2>
            <div>D: 20</div>
            <div>I: 15</div>
            <div>S: 20</div>
            <div>C: 20</div>
          </div>
          <div className="text-content">
            <h2>Header</h2>
            <p>Some text goes here</p>
          </div>
          <button className="download-button">Download Uitslag</button>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
